import React from 'react';
import podatak from '../data/utisci.json'


const mapirano = podatak.map((obj, i) => {
  return (
    <div key={i}>
      <p>{obj.ime} : {obj.utisak} <button>x</button></p>

    </div>
  )
});


export default function Main(props) {
    return (
        <main>
          <h2>Utisci potrosaca:</h2>
          {mapirano}
        </main>
    )
}
